import React, { Component } from 'react';
import { Header } from '../Gallery/style';
class Contact extends Component {
  render() {
    return (
      <div id="contact">
        <Header>
          <h1>Contact</h1>
          <p> We will always listen to you</p>
        </Header>
        <p> 8015643515 </p>
      </div>
    );
  }
}

export default Contact;
